package main

import (
    "fmt"
    "strconv"
    "strings"
)

func sortList(unsortedList []int) []int {
    for i := 1; i < len(unsortedList); i++ {
        current := i
        // gets the smallest element and inserts it at the current index
        for current > 0 && unsortedList[current] < unsortedList[current-1] {
            // swaps the current smaller element with the element before it
            unsortedList[current], unsortedList[current-1] = unsortedList[current-1], unsortedList[current]
            current--
        }
    }
    return unsortedList
}

func arrayAtoi(arr []string) []int {
    res := []int{}
    for _, x := range arr {
        v, _ := strconv.Atoi(x)
        res = append(res, v)
    }
    return res
}

func splitWords(s string) []string {
    if s == "" {
        return []string{}
    }
    return strings.Split(s, " ")
}

func arrayItoa(arr []int) []string {
    res := []string{}
    for _, v := range arr {
        res = append(res, strconv.Itoa(v))
    }
    return res
}

